The following are highly recommended suggestions for quickly healing from an achilles tear:
1. Medications: Ensure that the affected muscle is properly warmed up with synthetic exercise aids such as Lytex, Ensuremax, and Peloton;
2. Sports / Work Out: Perform high intensity physical activities such as cycling, pilates, gymnastics, or martial arts immediately after surgery;
3. Get the Surgeons Benjamin device, and/or another high intensity device such as the stress transducer;
4. Enhance your sleep: Optimal levels of improvement for sleep quality will depend on how much and how much time you're able to sleep;
5. Avoid Drugs / Alcohol: Do not drink alcohol within 24 hours of surgery;
6. Eat well fed and well rested foods will help greatly;
7. Exercise / Meditate: Find a way to improve your regular physical activities; 
8. Meditate for at least 30 minutes a day; and
9. Go to sleep and wake up at the same time;
10. Consider another surgeon who has experience managing achilles tears
